<template>
	<view class="activity-page">
		<!-- 顶部区域 -->
		<view class="top-section">
			<text class="title">活动中心</text>
			<view class="points-box">
				<view class="points-left">
					<text class="points-num">{{pointCount}}</text>
					<image class="coin-icon" src="https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/coin.png" webp="true" lazy-load="true"></image>
				</view>
				<text class="points-label">积分</text>
			</view>
			<text class="tips">连续签到即可获得奖励~</text>
			<view class="right-back"></view>
		</view>

		<!-- 签到区域 -->
		<view class="sign-section">
			<!-- 签到日历 -->
			<view class="sign-calendar">
				<!-- 第一排 -->
				<view class="calendar-row">
					<view v-for="day in firstDay" :key="day.value" class="day-item">
						<image class="heart-bg" :src="day.isActive ? day.activeBg : day.bg" webp="true"
							lazy-load="true"></image>
					</view>
				</view>
				<!-- 第二排 -->
				<view class="calendar-row second-row">
					<view v-for="day in seconedDay" :key="day.value" class="day-item">
						<image class="heart-bg" :src="day.isActive ? day.activeBg : day.bg" webp="true"
							lazy-load="true"></image>
					</view>
				</view>
			</view>

			<!-- 签到按钮 -->
			<view class="sign-btn" @tap="userCheckIn"> </view>
		</view>

		<!-- 活动区域 -->
		<view class="activity-grid">
			<view v-for="(item, index) in activities" :key="index" class="activity-item"
				:style="{ backgroundImage: `url(${item.bg})` }" @click="toPage(item)">
				<!-- 活动内容 -->
			</view>
		</view>
	</view>
</template>

<script>
	import {
		get,
		post
	} from "@/utils/rest-util.js"
	import {
		dateCompare,
		formatDate
	} from '@/utils/common.js'
	// import img from "../"
	export default {
		onLoad() {
			
		},

		onShow() {
			this.userId = uni.getStorageSync('userId');
			this.currentCheckInDay();
			this.userConsumptionInFirday()
		},
		data() {
			return {
				// 活动数据示例
				activities: [{
						bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/activity1.png',
						path:'/subActivity/record/index'
					},
					{
						bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/activity2.png',
						path: '/subActivity/lucky/index'
					},
					{
						bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/activity3.png',
						path:'/subActivity/soulPower/index'
					},
					{
						bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/activity4.png',
						path:'/subHome/market/index'
					}
				],
				firstDay: [{
					bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day1.png',
					activeBg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day1-active.png',
					isActive: false,
					value: 'day1'
				}, {
					bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day2.png',
					activeBg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day2-active.png',
					isActive: false,
					value: 'day2'
				}, {
					bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day3.png',
					activeBg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day3-active.png',
					isActive: false,
					value: 'day3'
				}, {
					bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day4.png',
					activeBg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day4-active.png',
					isActive: false,
					value: 'day4'
				}],
				seconedDay: [{
						bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day5.png',
						activeBg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day5-active.png',
						isActive: false,
						value: 'day5'
					},
					{
						bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day6.png',
						activeBg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day6-active.png',
						isActive: false,
						value: 'day6'
					}, {
						bg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day7.png',
						activeBg: 'https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/day7-active.png',
						isActive: false,
						value: 'day7'
					}
				],
				userId: '',
				currentDay: 0,
				pointCount: 0,
				lastCheckInDay: '',
				userInFirday: true
			}
		},

		methods: {
			toPage(item) {
				console.log(item.path)
				uni.navigateTo({
					url: item.path + '?userId=' + this.userId
				})
			},
			async userCheckIn() {
				const flag = await this.checkDate();
				if (flag) {
					uni.showToast({
						title: '您今日已签到'
					})
					return
				}
				if (this.userInFirday) {
					uni.showToast({
						title: '您最近五天没有消费，不允许签到',
						icon: 'none'
					})
					return
				}
				const day = this.currentDay >= 7 ? 1 : (this.currentDay === 0 ? 1 : this.currentDay + 1)
				const postData = {
					userId: this.userId,
					checkInDay: day,
					points: day < 3 ? day * 10 : 30
				}
				post('wx/checkin/userCheckIn', postData).then(res => {
					const result = res.data;
					if (result.errmsg === '成功') {
						uni.showToast({
							title: '签到成功'
						})
						this.currentCheckInDay()
					}
				})
			},
			userConsumptionInFirday() {
				get('wx/checkin/userConsumptionInFirday?userId=' + this.userId).then(res => {
					if (res.data.errmsg === '成功') {
						const result = res.data.data
						this.userInFirday = result.userConsumptionInFirday
					}
				})
			},
			currentCheckInDay() {
				get('wx/checkin/currentCheckInDay?userId=' + this.userId).then(res => {
					const result = res.data.data;
					this.currentDay = result.checkInDay
					this.pointCount = result.currentPoints;
					this.lastCheckInDay = result.lastCheckInDay;
					this.resetSignDay(result.checkInDay);
				})
			},
			checkDate() {
				const date = formatDate(new Date());
				return dateCompare(this.lastCheckInDay, date)
			},
			resetSignDay(day) {
				if (day > 4) {
					this.firstDay = this.firstDay.map(item => {
						return {
							...item,
							isActive: true
						}
					})
					this.seconedDay = this.seconedDay.map((item, i) => {
						const num = i + 5;
						return {
							...item,
							isActive: day >= num
						}
					})
				} else {
					this.firstDay = this.firstDay.map((item, i) => {
						const num = i + 1;
						return {
							...item,
							isActive: day >= num
						}
					})
				}
			}
		},

	}
</script>

<style lang="scss">
	.activity-page {
		padding: 30rpx 0px;
		background: #FFF5F3;
		/* 关键样式 */
		background-size: cover;
		/* 或使用 contain 根据需求 */
		background-position: center;
		background-repeat: no-repeat;
		transition: all 0.3s ease;
		background-image: url('https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/heart-bg.jpg');
	}

	.top-section {
		position: relative;
		padding: 20rpx 40rpx;

		.title {
			color: #D4A89A; // 粉褐色
			font-size: 36rpx;
			font-weight: bold;
		}

		.points-box {
			margin-top: 40rpx;
			display: flex;
			align-items: flex-end;

			.points-left {
				position: relative;

				.points-num {
					color: #FF4081; // 粉红色
					font-size: 80rpx;
					line-height: 1;
				}

				.coin-icon {
					position: absolute;
					right: -50rpx;
					bottom: 10rpx;
					width: 40rpx;
					height: 40rpx;
				}
			}

			.points-label {
				color: #D4A89A;
				font-size: 28rpx;
				margin-left: 60rpx;
				padding-bottom: 8rpx;
			}
		}

		.tips {
			display: block;
			margin-top: 20rpx;
			color: #D4A89A;
			font-size: 40rpx;
			font-weight: bold;
		}

		.right-back {
			position: absolute;
			right: 30rpx;
			bottom: 0px;
			width: 250rpx;
			height: 250rpx;
			/* 关键样式 */
			background-size: cover;
			/* 或使用 contain 根据需求 */
			background-position: center;
			background-repeat: no-repeat;
			background-image: url('https://chaoshangshiduo-public-static.oss-cn-shenzhen.aliyuncs.com/right-top-image.png');
		}
	}

	.sign-section {
		margin-top: 40rpx;
		background: #FFFFFF;
		border-radius: 20rpx;
		padding: 30rpx 15rpx;
		background-image: url('data:image/png;base64,');
		/* 关键样式 */
		background-size: cover;
		/* 或使用 contain 根据需求 */
		background-position: center;
		background-repeat: no-repeat;
		transition: all 0.3s ease;

		.sign-calendar {
			.calendar-row {
				display: flex;
				justify-content: space-between;
				margin-bottom: 30rpx;

				.day-item {
					position: relative;
					width: 160rpx;
					height: 160rpx;

					.heart-bg {
						position: absolute;
						width: 100%;
						height: 100%;
					}

					.day-text {
						position: absolute;
						top: 30rpx;
						left: 50%;
						transform: translateX(-50%);
						color: #333;
						font-size: 28rpx;
						z-index: 2;
					}

					.coin-small {
						position: absolute;
						top: 90rpx;
						left: 50%;
						transform: translateX(-50%);
						width: 40rpx;
						height: 40rpx;
					}

					.points-add {
						position: absolute;
						bottom: 30rpx;
						left: 50%;
						transform: translateX(-50%);
						color: #333;
						font-size: 24rpx;
					}
				}
			}
		}

		.sign-btn {
			margin-top: 40rpx;
			border-radius: 12rpx;
			height: 120rpx;
			display: flex;
			align-items: center;
			justify-content: center;
			background-image: url('data:image/png;base64,');
			background-repeat: no-repeat;
			background-size: 50%;
			/* 自定义缩放比例 */
			background-position: 50% 50%;
			/* 定位到图片特定区域 */
		}
	}

	.second-row {
		margin-left: 60rpx;
		margin-right: 60rpx;
	}

	.activity-grid {
		margin-top: 40rpx;
		grid-template-columns: repeat(4, 1fr);
		gap: 20rpx;
		padding: 0 30rpx;

		.activity-item {
			height: 100rpx;
			background-size: cover;
			border-radius: 12rpx;
			margin-top: 15rpx;
			background-repeat: no-repeat;
			background-size: 100%;
			/* 自定义缩放比例 */
			background-position: 50% 50%;
		}
	}
</style>